import React from 'react';

function BeauYeRoc() {
  return (
    <div id="beauyeroc" className="component">
      <h1>beau yé roc</h1>
      <h2>black•world musician.</h2>
      <div>
      <iframe style="border: 0; width: 350px; height: 470px;" src="https://bandcamp.com/EmbeddedPlayer/album=4108592743/size=large/bgcol=ffffff/linkcol=333333/tracklist=false/transparent=true/" seamless><a href="https://beauyeroc.bandcamp.com/album/new-afrika-21">new afrika, &#39;21 by beau yé roc</a></iframe>
        <iframe title="staff-picks" src="https://bandcamp.com/EmbeddedPlayer/album=1702852258/size=large/bgcol=ffffff/linkcol=333333/tracklist=false/transparent=true/" seamless><a href="https://beauyeroc.bandcamp.com/album/staff-picks-new-world-anthology">staff picks (new world anthology) by beau yé roc</a></iframe>
        <iframe title="world-literature-for-mutual-aid" src="https://bandcamp.com/EmbeddedPlayer/album=3041135610/size=large/bgcol=ffffff/linkcol=333333/minimal=true/transparent=true/" seamless><a href="https://beauyeroc.bandcamp.com/album/world-literature-for-mutual-aid">world literature for mutual aid * by beau yé roc</a></iframe>
        <iframe title="new-world-series" src="https://bandcamp.com/EmbeddedPlayer/album=1502250368/size=large/bgcol=ffffff/linkcol=333333/minimal=true/transparent=true/" seamless><a href="https://beauyeroc.bandcamp.com/album/new-world-series-2">new world series by beau yé roc</a></iframe>
        <iframe title="world-art-pt-i" src="https://bandcamp.com/EmbeddedPlayer/album=494057737/size=large/bgcol=ffffff/linkcol=333333/minimal=true/transparent=true/" seamless><a href="https://beauyeroc.bandcamp.com/album/world-art-pt-i">world art, pt. i by beau yé roc</a></iframe>
      </div>
    </div>
  )
}

export default BeauYeRoc;
